import React, { useState } from 'react';
import './login.css';

const LoginPage = () => {
  const [formData, setFormData] = useState({
    email: '',
    password: ''
  });
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState('');

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));


    // ÏûÖÎ†• Ïãú ÏóêÎü¨ Î©îÏãúÏßÄ ÌÅ¥Î¶¨Ïñ¥
    if (error) {
      setError('');

    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setIsLoading(true);
    setError('');



    // Í∏∞Î≥∏ Ïú†Ìö®ÏÑ± Í≤ÄÏÇ¨
    if (!formData.email || !formData.password) {
      setError('Ïù¥Î©îÏùºÍ≥º ÎπÑÎ∞ÄÎ≤àÌò∏Î•º Î™®Îëê ÏûÖÎ†•Ìï¥Ï£ºÏÑ∏Ïöî.');
      setIsLoading(false);
      return;
    }

    // Ïù¥Î©îÏùº ÌòïÏãù Í≤ÄÏÇ¨
    const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
    if (!emailRegex.test(formData.email)) {
      setError('Ïò¨Î∞îÎ•∏ Ïù¥Î©îÏùº ÌòïÏãùÏùÑ ÏûÖÎ†•Ìï¥Ï£ºÏÑ∏Ïöî.');
      setIsLoading(false);
      return;
    }

    try {
      // Ïó¨Í∏∞Ïóê Ïã§Ï†ú Î°úÍ∑∏Ïù∏ API Ìò∏Ï∂úÏùÑ Ï∂îÍ∞ÄÌïòÏÑ∏Ïöî
      console.log('Î°úÍ∑∏Ïù∏ ÏãúÎèÑ:', formData);

      // ÏûÑÏãú Î°úÍ∑∏Ïù∏ Î°úÏßÅ (Ïã§Ï†ú Íµ¨ÌòÑ Ïãú Spring Boot APIÏôÄ Ïó∞Îèô)
      await new Promise(resolve => setTimeout(resolve, 1000)); // 1Ï¥à ÎåÄÍ∏∞

      // ÏÑ±Í≥µ Ïãú Ï≤òÎ¶¨
      alert('Î°úÍ∑∏Ïù∏ ÏÑ±Í≥µ!');
      // Ïó¨Í∏∞Ïóê Î¶¨Îã§Ïù¥Î†âÌä∏ ÎòêÎäî ÏÉÅÌÉú Î≥ÄÍ≤Ω Î°úÏßÅ Ï∂îÍ∞Ä

    } catch (err) {
      setError('Î°úÍ∑∏Ïù∏Ïóê Ïã§Ìå®ÌñàÏäµÎãàÎã§. Ïù¥Î©îÏùºÍ≥º ÎπÑÎ∞ÄÎ≤àÌò∏Î•º ÌôïÏù∏Ìï¥Ï£ºÏÑ∏Ïöî.');
      console.error('Î°úÍ∑∏Ïù∏ ÏóêÎü¨:', err);
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <div className="login-container">
      <div className="login-box">
        <div className="login-header">
          <h1>üé∞ Î≥µÍ∂å ÏãúÏä§ÌÖú</h1>
          <h2>Î°úÍ∑∏Ïù∏</h2>
          <p>Í≥ÑÏÜçÌïòÎ†§Î©¥ Î°úÍ∑∏Ïù∏ÌïòÏÑ∏Ïöî</p>
        </div>

        <form onSubmit={handleSubmit} className="login-form">
          <div className="form-group">
            <label htmlFor="email">Ïù¥Î©îÏùº</label>
            <input
              type="email"
              id="email"
              name="email"
              value={formData.email}
              onChange={handleInputChange}
              placeholder="example@email.com"
              required
              disabled={isLoading}
            />
          </div>

          <div className="form-group">
            <label htmlFor="password">ÎπÑÎ∞ÄÎ≤àÌò∏</label>
            <input
              type="password"
              id="password"
              name="password"
              value={formData.password}
              onChange={handleInputChange}
              placeholder="ÎπÑÎ∞ÄÎ≤àÌò∏Î•º ÏûÖÎ†•ÌïòÏÑ∏Ïöî"
              required
              disabled={isLoading}
            />
          </div>

          {error && (
            <div className="error-message">
              {error}
            </div>
          )}

          <button 
            type="submit" 
            className="login-button"
            disabled={isLoading}
          >
            {isLoading ? (
              <>
                <span className="spinner"></span>
                Î°úÍ∑∏Ïù∏ Ï§ë...
              </>
            ) : (
              'Î°úÍ∑∏Ïù∏'
            )}
          </button>
        </form>

        <div className="login-footer">
          <div className="forgot-password">
            <a href="#forgot">ÎπÑÎ∞ÄÎ≤àÌò∏Î•º ÏûäÏúºÏÖ®ÎÇòÏöî?</a>
          </div>
          <div className="signup-link">
            <span>Í≥ÑÏ†ïÏù¥ ÏóÜÏúºÏã†Í∞ÄÏöî? </span>
            <a href="#signup">ÌöåÏõêÍ∞ÄÏûÖ</a>
          </div>
        </div>

        <div className="divider">
          <span>ÎòêÎäî</span>
        </div>

        {/* <div className="social-login">
          <button className="social-button google">
            <span>üîç</span>
            GoogleÎ°ú Î°úÍ∑∏Ïù∏
          </button>
          <button className="social-button kakao">
            <span>üí¨</span>
            Ïπ¥Ïπ¥Ïò§Î°ú Î°úÍ∑∏Ïù∏
          </button>
        </div> */}
      </div>
    </div>
  );
};

export default LoginPage;
